import axios from 'axios'
const http = axios.create({
  baseURL: 'http://localhost:3000/admin/api'
})
// 当请求数据相应回来的状态码大于200时，对错误的通用处理
http.interceptors.response.use(
  (res) => {
    return res
  },
  (err) => {
    if (err.response.data.message) {
    }
  }
)
export default http
